import React, { createContext, useContext, useEffect, useState } from 'react';
import { User, Session } from '@supabase/supabase-js';
import { supabase } from '@/integrations/supabase/client';
import { useToast } from '@/hooks/use-toast';

interface AuthContextType {
  user: User | null;
  session: Session | null;
  signUp: (email: string, password: string, firstName?: string, lastName?: string) => Promise<{ error: any }>;
  signIn: (email: string, password: string) => Promise<{ error: any }>;
  signOut: () => Promise<void>;
  authenticateWithBiometrics: () => Promise<boolean>;
  loading: boolean;
}

const AuthContext = createContext<AuthContextType | undefined>(undefined);

export const AuthProvider: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const [user, setUser] = useState<User | null>(null);
  const [session, setSession] = useState<Session | null>(null);
  const [loading, setLoading] = useState(true);
  const { toast } = useToast();

  useEffect(() => {
    // Set up auth state listener FIRST
    const { data: { subscription } } = supabase.auth.onAuthStateChange(
      (event, session) => {
        console.log('Auth state changed:', event, session?.user?.id);
        setSession(session);
        setUser(session?.user ?? null);
        setLoading(false);
      }
    );

    // THEN check for existing session
    supabase.auth.getSession().then(({ data: { session } }) => {
      setSession(session);
      setUser(session?.user ?? null);
      setLoading(false);
    });

    return () => subscription.unsubscribe();
  }, []);

  const signUp = async (email: string, password: string, firstName?: string, lastName?: string) => {
    const redirectUrl = `${window.location.origin}/`;

    const { error } = await supabase.auth.signUp({
      email,
      password,
      options: {
        emailRedirectTo: redirectUrl,
        data: {
          first_name: firstName,
          last_name: lastName,
        }
      }
    });

    if (error) {
      toast({
        title: 'Registrierung fehlgeschlagen',
        description: error.message,
        variant: 'destructive'
      });
    } else {
      toast({
        title: 'Registrierung erfolgreich',
        description: 'Bitte überprüfe deine E-Mail für die Bestätigung'
      });
    }

    return { error };
  };

  const signIn = async (email: string, password: string) => {
    const { error } = await supabase.auth.signInWithPassword({
      email,
      password,
    });

    if (error) {
      toast({
        title: 'Anmeldung fehlgeschlagen',
        description: error.message,
        variant: 'destructive'
      });
    } else {
      toast({
        title: 'Anmeldung erfolgreich',
        description: 'Willkommen zurück!'
      });
    }

    return { error };
  };

  const signOut = async () => {
    const { error } = await supabase.auth.signOut();
    if (error) {
      console.error('Error signing out:', error);
      toast({
        title: 'Fehler beim Abmelden',
        description: error.message,
        variant: 'destructive'
      });
    } else {
      toast({
        title: 'Erfolgreich abgemeldet',
        description: 'Auf Wiedersehen!'
      });
    }
  };

  const authenticateWithBiometrics = async (): Promise<boolean> => {
    try {
      // For now, simulate biometric authentication (will be replaced with real implementation)
      const userConfirmed = window.confirm(
        "Biometrische Authentifizierung simuliert.\n\nIn der echten App würde hier Fingerabdruck/Gesichtserkennung verwendet werden.\n\nMöchtest du fortfahren?"
      );

      if (userConfirmed) {
        toast({
          title: 'Authentifizierung erfolgreich',
          description: 'Biometrische Anmeldung bestätigt (simuliert)'
        });
        return true;
      } else {
        toast({
          title: 'Authentifizierung abgebrochen',
          description: 'Biometrische Anmeldung abgebrochen',
          variant: 'destructive'
        });
        return false;
      }
    } catch (error) {
      console.error('Biometric authentication error:', error);
      toast({
        title: 'Authentifizierung nicht möglich',
        description: 'Biometrische Anmeldung nicht verfügbar',
        variant: 'destructive'
      });
      return false;
    }
  };

  return (
    <AuthContext.Provider
      value={{
        user,
        session,
        signUp,
        signIn,
        signOut,
        authenticateWithBiometrics,
        loading,
      }}
    >
      {children}
    </AuthContext.Provider>
  );
};

export const useAuth = () => {
  const context = useContext(AuthContext);
  if (context === undefined) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
};

import React, { createContext, useContext, useState, useEffect, ReactNode } from 'react';
import { Preferences } from '@capacitor/preferences';

export interface UserProfile {
  name: string;
  homeAddress: string;
  email: string;
  preferredEmailApp: string;
  gpsEnabled: boolean;
  localStoragePath: string;
  // Email report recipients
  reportTo?: string | null;
  reportCc?: string | null;
  reportBcc?: string | null;
}

interface UserProfileContextType {
  profile: UserProfile;
  updateProfile: (updates: Partial<UserProfile>) => Promise<void>;
  isLoading: boolean;
}

const defaultProfile: UserProfile = {
  name: '',
  homeAddress: '',
  email: '',
  preferredEmailApp: 'default',
  gpsEnabled: false,
  localStoragePath: '',
  reportTo: null,
  reportCc: null,
  reportBcc: null,
};

const UserProfileContext = createContext<UserProfileContextType | undefined>(undefined);

export const useUserProfile = () => {
  const context = useContext(UserProfileContext);
  if (!context) {
    throw new Error('useUserProfile must be used within a UserProfileProvider');
  }
  return context;
};

interface UserProfileProviderProps {
  children: ReactNode;
}

export const UserProfileProvider: React.FC<UserProfileProviderProps> = ({ children }) => {
  const [profile, setProfile] = useState<UserProfile>(defaultProfile);
  const [isLoading, setIsLoading] = useState(true);

  console.log('UserProfileProvider render:', { isLoading });

  // Load profile on mount
  useEffect(() => {
    console.log('UserProfileProvider: useEffect triggered');
    loadProfile();
  }, []);

  const loadProfile = async () => {
    console.log('UserProfile: Loading profile...');
    const storageKey = 'userProfile';
    try {
      let value: string | null = null;
      try {
        const res = await Preferences.get({ key: storageKey });
        value = res.value ?? null;
        console.log('UserProfile: Got from Capacitor:', value);
      } catch (e) {
        console.warn('UserProfile: Capacitor Preferences.get failed, falling back to localStorage', e);
        value = localStorage.getItem(storageKey);
      }
      // Extra fallback in case value is still null
      if (!value) {
        value = localStorage.getItem(storageKey);
        console.log('UserProfile: Got from localStorage fallback:', value);
      }
      if (value) {
        const savedProfile = JSON.parse(value);
        console.log('UserProfile: Parsed saved profile:', savedProfile);

        // Migration: Set reportTo to email if not set
        const migratedProfile = { 
          ...defaultProfile, 
          ...savedProfile,
          reportTo: savedProfile.reportTo ?? (savedProfile.email || null)
        };

        setProfile(migratedProfile);
        console.log('UserProfile: Profile loaded successfully');
      } else {
        console.log('UserProfile: No saved profile, using defaults');
      }
    } catch (error) {
      console.error('UserProfile: Error loading profile:', error);
    } finally {
  console.log('UserProfile: Setting loading to false');
      setIsLoading(false);
    }
  };

  // Safety timeout to prevent infinite loading
  useEffect(() => {
    const timeout = setTimeout(() => {
      if (isLoading) {
        console.warn('UserProfile: Loading timeout, forcing completion');
        setIsLoading(false);
      }
    }, 3000);

    return () => clearTimeout(timeout);
  }, [isLoading]);

  const updateProfile = async (updates: Partial<UserProfile>) => {
    const storageKey = 'userProfile';
    console.log('updateProfile called with:', updates);
    try {
      const newProfile = { ...profile, ...updates };
      console.log('New profile:', newProfile);
      setProfile(newProfile);

      const serialized = JSON.stringify(newProfile);
      console.log('Serialized profile:', serialized);

      // Try Capacitor Preferences first, fallback to localStorage
      let saved = false;
      try {
        await Preferences.set({
          key: storageKey,
          value: serialized
        });
        console.log('Saved via Capacitor Preferences');
        saved = true;
      } catch (e) {
        console.warn('Capacitor Preferences.set failed:', e);
      }

      if (!saved) {
        localStorage.setItem(storageKey, serialized);
        console.log('Saved via localStorage fallback');
      }

      console.log('Profile update completed successfully');
    } catch (error) {
      console.error('Error saving user profile:', error);
      throw error;
    }
  };

  return (
    <UserProfileContext.Provider value={{ profile, updateProfile, isLoading }}>
      {children}
    </UserProfileContext.Provider>
  );
};
